function drawCircle(x, y, radius, thickness, R, G, B){
if (thickness < 0){
ctx.fillStyle=rgb(R,G,B);ctx.beginPath();ctx.arc(x, y, radius, 0, Math.PI * 2, true);ctx.fill();
}
else{
ctx.strokeStyle = rgb(R,G,B);ctx.lineWidth = thickness;ctx.beginPath();ctx.arc(x, y, radius, 0, Math.PI * 2, false);ctx.stroke();
}
}
function drawBox(x1, y1, x2, y2, thickness, R, G, B){
var w=x2-x1, h=y2-y1;
if(thickness<0){
ctx.fillStyle=rgb(R,G,B);ctx.fillRect(x1, y1, w, h);

else{
ctx.lineWidth=thickness;ctx.strokeStyle=rgb(R,G,B);ctx.strokeRect(x1, y1, w, h);
}
}
function drawLine(x1, y1, x2, y2, thickness, R, G, B){
ctx.lineWidth=thickness;ctx.strokeStyle=rgb(R,G,B);ctx.beginPath();ctx.moveTo(x1, y1);ctx.lineTo(x2, y2);ctx.stroke();
}
